import React from 'react';
import Logo from '../asset/image/logo.png';
const First_Main = () => {
  return (
    <div>
      <img
        src={Logo}
        alt='logo'
        style={{
          width: '200px',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center'
        }}
      />
      <p
        style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          color: '#21385e',
          fontWeight: 'bold'
        }}
      >
        MENTAL HEALTHCARE APP
      </p>
    </div>
  );
};

export default First_Main;
